messages.content:
@tarunon 
ContainerViewのレイアウトについてもお聞きしていいですか？

こちらの使ってないContainerViewが二つ（上の青いものと、下の真ん中の赤いもの）あると思うのですが、これらはなんのためにあるのでしょうか？

@tarunon さん、MicroViewControllerのやり方について、質問があります。
親VCと子VCのやりとりって、 `Injectable`や `Interactable`などのProtocolを介すやりとり以外はしていない感じでしょうか？

Frameworkをまたぐ時にはTypeErasureのためにそういったのが必要になるのもわかるのですが、Framework内のVC同士の値のやりとりって割と自由にしてもいいものでしょうか？

最初聞いたときはこういうのを想像していましたが
```
public protocol Instantiatable {
    associatedtype Input
    associatedtype Environment
    associatedtype Storage
    var environment: Environment { get }
    var storage: Storage { get }
    init(with input: Input, environment: Environment, storage: Storage)
}
```
